import gradient from "./assets/Image.png";

export default function App() {
  return (
    <main className="bg-[#FCFCFD] w-screen px-4 py-8">
      <section className="border-b-[1px] pb-4 flex justify-between border-[#EAECF0]">
        <div>
          <h1>Welcome</h1>
          <p>Your current sales auction and activity.</p>
        </div>
        <div></div>
      </section>
      <section className="h-[330px] rounded-xl border-[1px] border-[#EAECF0] p-4">
        <img
          src={gradient}
          alt={"Gradient"}
          className="w-full h-[192px] rounded-lg"
        />
        <div className="flex justify-between">
          <img src={logo} alt={"Gradient"} className="rounded-full" />
        </div>
      </section>
    </main>
  );
}
